Technology Documentary hosted by Emmanuel Belliveau, published by Freemantal Media in 2009 - English narration


Information
------------------------------

World's Greenest Homes: Season 1 
In World's Greenest Homes, we're treated to a visually stunning; all access tour of some of the most extraordinary houses ever built. Aspirational, inspiring and captivating, each half-hour show explores two of the world's most exceptional green homes. Along the way there are insights from the passionate owners and the architects responsible for these dream creations, and intriguing interviews with the designers and experts responsible for the incredible green gizmos that make these homes so special.




16)  Wis Tavern 
Emmanuel visits a cliffside Toronto home that pushes green to the extreme. Then, a Chicago couple with a punk rock label transformed a turn-of-the-century tavern into the greenest live-work space in the city.



